import React from 'react';
import {Component} from 'react'
import './App.css';
import Person from './Person/person'

class App extends Component{

  state={

    people:[{p_name:'amit Yadav',p_age:'30'},{p_name:'shweta Yadav',p_age:'32'},{p_name:'usha',p_age:'34'}],

    people_info:'belong to same family '
  }


  render(){
    return (
      <div className="App">
        <h1>helloamit React js</h1>
        <Person name='Amit' age='23'></Person>
        <Person name='shweta' age='19'></Person>
        <Person name='usha' age='25'>from Allahabad</Person>

      </div>
    );
  }
}

export default App;
